import React, { Component } from 'react';
import ReactPlayer from "react-player";


function Videos() {
    
        return(<div className="Videos">
              <header className="videos">
        <ReactPlayer url="https://www.youtube.com/watch?v=g4LyzhkDNBM" controls={true}/>
            <h1></h1>
        <ReactPlayer url="https://www.youtube.com/watch?v=1t-GbIbVHCI" controls={true}/>
              </header>
              </div>
        )
    
}
export default Videos;
